class Solution:
    def minimumOperations(self, nums: List[int], target: List[int]) -> int:
        import numpy as np
        diff = np.array(nums) - target
        diff = np.append(diff, [0])
        for i in range(len(diff) - 1, 0, -1):
            diff[i] -= diff[i - 1]
        return int(np.sum([x for x in diff if x > 0]))
